import React from 'react'
import homePage from "./Sites/homePage"
import LogIn from "./Sites/LogIn"
import {Routes, Route} from "react-dom"

const App = () => {
    return(
        <Routes>
            <Route path="/" element={<homePage />}/>
            <Route path="/LogIn" element={<logIn />}/>
        </Routes>
    )
}

export default App;
